import React from 'react';

const Table = ({ droplets }) => {
  return (
    <table>
      <thead>
        <tr>
          <th>Id</th>
          <th>Name</th>
          <th>Type</th>
          <th>Address</th>
          <th>Website URL</th>
        </tr>
      </thead>
      <tbody>
      { (droplets.length > 0) ? droplets.map( (droplet, index) => {
           return (
            <tr key={ index }>
              <td>{ droplet.id }</td>
              <td>{ droplet.name }</td>
              <td>{ droplet.brewery_type}</td>
              <td>{ droplet.street } { droplet.city } { droplet.state } { droplet.postal_code }</td>
              <td>{ droplet.website_url }</td>
            </tr>
          )
         }) : <tr><td colSpan="5">Loading...</td></tr> }
      </tbody>
    </table>
  );
}

export default Table
